    t[168] = "Base32 address decryption failure, check encryption key";
    t[169] = "\u0634\u06a9\u0633\u062a \u062f\u0631 \u0631\u0645\u0632\u06af\u0634\u0627\u06cc\u06cc \u0622\u062f\u0631\u0633 Base32\u060c \u06a9\u0644\u06cc\u062f \u0631\u0645\u0632\u06af\u0630\u0627\u0631\u06cc \u0631\u0627 \u0628\u0631\u0631\u0633\u06cc \u06a9\u0646\u06cc\u062f";
