    t[269] = "\u0645\u06cc \u062a\u0648\u0627\u0646\u06cc\u062f \u0628\u062f\u0648\u0646 \u0630\u062e\u06cc\u0631\u0647 \u0622\u0646 \u062f\u0631 \u062f\u0641\u062a\u0631\u0686\u0647 \u0622\u062f\u0631\u0633 \u060c \u0628\u0647 \u0633\u0627\u06cc\u062a \u0645\u0631\u0648\u0631 \u06a9\u0646\u06cc\u062f. \u0622\u062f\u0631\u0633 \u062a\u0627 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0631\u0648\u062a\u0631 I2P \u062e\u0648\u062f \u0631\u0627 \u0645\u062c\u062f\u062f\u0627\u064b \u0631\u0627\u0647 \u0627\u0646\u062f\u0627\u0632\u06cc \u06a9\u0646\u06cc\u062f \u060c \u0628\u0647 \u06cc\u0627\u062f \u0645\u06cc \u0622\u0648\u0631\u06cc\u062f.";
    t[276] = "Seeing this page often? See {0}the FAQ{1} for help in {2}adding some subscriptions{3} to your addressbook.";
    t[277] = "\u062f\u06cc\u062f\u0646 \u0627\u06cc\u0646 \u0635\u0641\u062d\u0647 \u0627\u063a\u0644\u0628\u061f \u0628\u0631\u0627\u06cc \u06a9\u0645\u06a9 \u0628\u0647 {2} \u0627\u0636\u0627\u0641\u0647 \u06a9\u0631\u062f\u0646 \u0628\u0631\u062e\u06cc \u0627\u0632 \u0627\u0634\u062a\u0631\u0627\u06a9 \u0647\u0627 {3} \u0628\u0647 \u062f\u0641\u062a\u0631\u0686\u0647 \u0622\u062f\u0631\u0633 \u062e\u0648\u062f \u060c \u0628\u0647 {0} faq {1} \u0645\u0631\u0627\u062c\u0639\u0647 \u06a9\u0646\u06cc\u062f.";
